import * as Types from "./types";
import Axios from "axios";



export const book_list = () => dispatch => {
  Axios.get("/book/")
    .then(res => {
      dispatch({
        type: Types.BOOK_LIST,
        payload: {
          book_list: res.data
        }
      });
    })
    .catch(error => {
   
    });
};
